import React from 'react'

function Navbar() {
  return (
    <nav className='navbar bg-dark navbar-expand-lg'>
        <ul className='navbar nav ms-auto px-5 my-3' style={{listStyle:"none"}}>
            <li><a className='nav-link text-light' href="/">Home</a></li>
            <li><a className='nav-link text-light' href="/">Wazuh  </a></li>
            <li><a className='nav-link text-light' href="/">SIEM</a></li>
        </ul>

    </nav>
  )
}

export default Navbar
